                fr: "52% Polyester / 47% Acrylique / 1% Elasthanne. Contient au moins 50% de polyester recyclé. Fabriqué à partir de 100% de PET, équivalent à environ 1,5 bouteille post-consommation. Tricot côtelé. Tricot à une seule couche. Couronne peu profonde. Couronne conçue pour un confort maximal. Étiquette TearAway pour faciliter le marquage.",
                it: "52% poliestere / 47% acrilico / 1% elastan. Contiene almeno il 50% di poliestere riciclato. Prodotto con il 100% di PET, pari a circa 1,5 bottiglie post-consumo. Lavorato a maglia a costine. Lavorato a maglia con un solo strato. Vestibilità poco profonda per il massimo comfort. Etichetta staccabile per facilitare l'applicazione del logo.",
                nl: "52% polyester / 47% acryl / 1% elasthan. Bevat minstens 50% gerecycleerd polyester. Gemaakt van 100% PET, het equivalent van ongeveer 1,5 post-consumer fles. Geribd tricot. Gebreid in één laag. Ondiepe kroon. Kroon ontwikkeld met het oog op maximaal comfort. TearAway-label voor eenvoudige bedrukking.",
                pt: "52% poliéster/47% acrílico/1% elastano. Contém no mínimo 50% poliéster reciclado. Fabricado a aprtir de 100% PET, equivalente a 1,5 garrafas pós-consumo. Malha canelada. Malha com apenas uma camada. Copa pouco profunda, concebida para um conforto excepcional. Etiqueta TearAway para facilitar a personalização.",
